import Box from '../component/box.js';

import {connect} from "react-redux";
import * as actionCreators from "../actions/index.js";


class BoxCon extends React.Component{
    render(){
        return (
            <Box 

            handleClick={this.props.loadScoreData} buttonNumber={this.props.id} data={this.props.data}
            handleSeasonClick={this.props.loadScoreData} buttonNumber={this.props.id} data={this.props.data}

            //handleSeasonClick={this.props.}

            ></Box>
        )
    }
}

const mapStateToProps=(state)=>{
    return state
};

export default connect (mapStateToProps, actionCreators)(BoxCon);
